import { useState } from 'react'
import './App.css'
import Button from './components/Button'
import Counter from './components/Counter'

const texts = ['Click me', 'Click me please', 'Hit me', 'Pess me']

function App() {
  const [count, setCount] = useState(0)
  const incrementCount = () => {
    setCount(count + 1)
  }
  return (
    <div className="App">
      <Counter count={count}> </Counter>
      <Button onClick={incrementCount} text={texts[0]}></Button>
      <Button onClick={incrementCount} text="Click me please"></Button>
      <Button onClick={incrementCount} text="Hit me"></Button>
      <Button onClick={incrementCount} text="Pess me"></Button>
    </div>
  )
}

export default App
